¡Todos deseamos lo mismo para nuestra @selevinotinto!

Este año cerramos con la convicción de que el sueño de todos es posible. En este proyecto tuvimos la oportunidad de ser testigos de cómo jugadores, cuerpo técnico y la gente coinciden y tienen la fe puesta en un mismo objetivo.

Desde TGP Media, queremos agradecer a todos los que han trabajado con nosotros para lograr piezas que conecten con la emoción de los venezolanos por nuestra selección. Su compromiso y dedicación han sido fundamentales. Por eso, estamos orgullosos de lo que hemos construido y de todo lo que queremos alcanzar.

